import React, { Component } from 'react'
import SearchIcon from '../../../Icons/SearchIcon'

export default class Search extends Component {
  handleKeyDown = (event) =>{
    event
  }
  render() {
    return (
      <div className='Search'>
        <SearchIcon />
        <input onKeyDown={this.handleKeyDown}></input>
      </div>
    )
  }
}
